import React from 'react';
import styled from 'styled-components';

const SideBar = styled.div`
display:flex;
width:180px;
position:absolute;
z-Index:1;
flex-direction:column;
min-height:90%;
align-items:center;
width: 240px;
padding: 0 0 552px;
background-color: rgba(1, 101, 255, 0.85);
`;

const SideBarItem = styled.div``;



const Sidebar = () => {
    return (
        <SideBar>
<div>one</div>
<div>one</div>
<div>one</div>
<div>one</div>
        </SideBar>
    );
};

export default Sidebar;
